import React from 'react'
import { Box, styled, Typography } from "@mui/material";
import { Container } from "@mui/system";
import lapimg from "../media/photoLap.jpg"

const Abouts = () => {
    const ContBox = styled(Box)(({theme}) => ({
        display:"flex",
        justifyContent:"center",
        gap: theme.spacing(10),
        [theme.breakpoints.down("md")]: {
            flexDirection: "column",
            alignItems: "center",
            textAlign: "center",
          },
    }));
  return (
    <Box sx={{textAlign:"center", paddingTop:"40px", paddingBottom:"40px"}}>
      <Typography
        variant="h3"
        sx={{ fontSize: "35px", fontWeight: "bold", color: "#000339", my: 3 }}
      >
        About Me
      </Typography>
        <ContBox>
          
          <Box>
            <p >
              I'm Sauarbh , I've completed 3 year diploma in computer science<br/> 
              from feroze gandhi polytechnic raebareli with 77 percentile in 2021<br/>
              after that i've joined a 6 month full stack web development training<br/>
              from edyoda technologies banglore, and made many projects and <br/>
              Now I want to join a company to show my skills...
            </p>
          </Box>
        </ContBox>
    </Box>
  )
};

export default Abouts
